import { ReactComponent as UpArrow } from '../assets/arrow-alt-circle-up-solid.svg';
import { ReactComponent as DownArrow } from '../assets/arrow-alt-circle-down-solid.svg';
import projects from '../assets/projects/projects';


export default function Projects(props) {
    projects[0].image = '../assets/apps_images/Fashion_Footprint.png';
    projects[1].image = '../assets/apps_images/SuitApp.png';
    projects[2].image = '../assets/apps_images/Escape_The_Dungeon.png';
    projects[3].image = '../assets/apps_images/Pokemon_Battle.png';
    projects[4].image = '../assets/apps_images/Memory_Game.png';
    projects[5].image = '../assets/apps_images/Tic_Tac_Toe.png';
    projects[6].image = '../assets/apps_images/Todos.png';

    const style = {
        background: `url(${require('../assets/coding-screen.png')}) no-repeat center center fixed`,
        WebkitBackgroundSize: 'cover',
        MozBackgroundSize: 'cover',
        OBackgroundSize: 'cover',
        backgroundSize: 'cover',
    }

    return(
        <section className='container-fluid p-3' id='projects' style={style}>
            <div className='d-flex justify-content-between'>
                <AnchorLink href='#navbar'>
                    <HomeIcon className='navIcon'/>
                </AnchorLink>
                <AnchorLink href='#skills'>
                    <UpArrow className='navIcon'/>
                </AnchorLink>
            </div>
            <div className='container-md appSection mx-3-auto'>
                {/* <div className='row row-cols-1 row-cols-md-2'>
